import React from 'react';
import { usePonto } from '../context/PontoContext';

const AjustesPontoTab = () => {
  const { solicitacoesAjuste } = usePonto() || { solicitacoesAjuste: [] };

  return (
    <div>
      <h2>Ajustes de Ponto</h2>
      <ul>
        {solicitacoesAjuste.length > 0 ? (
          solicitacoesAjuste.map((ajuste, index) => (
            <li key={index}>{ajuste.descricao}</li>
          ))
        ) : (
          <p>Nenhuma solicitação de ajuste.</p>
        )}
      </ul>
    </div>
  );
};

export default AjustesPontoTab;
